import React, { useState } from "react";

const OrderForm = () => {
  const [formData, setFormData] = useState({
    name: "",
    email: "",
    products: [],
    notes: "",
  });
  const [submitted, setSubmitted] = useState(false);

  const productOptions = [
    "Lavender Oil",
    "Lemon Oil",
    "Mint Essential Oil",
    "Avocado Oil",
    "Frankincense & Myrrh Essential Oil",
    "Native African Pear Oil",
  ];

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    if (type === "checkbox") {
      setFormData((prev) => ({
        ...prev,
        products: checked
          ? [...prev.products, value]
          : prev.products.filter((item) => item !== value),
      }));
    } else {
      setFormData((prev) => ({ ...prev, [name]: value }));
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    const formPayload = new FormData();
    formPayload.append("entry.1283017321", formData.name);
    formPayload.append("entry.1030028353", formData.email);
    formPayload.append("entry.362728841", formData.products.join(", "));
    formPayload.append("entry.1809893972", formData.notes);

    try {
      await fetch(
        "https://docs.google.com/forms/d/e/1FAIpQLSePSc0eb42eMrU-KGKZiPbTtXGKmItQU6ds2Mw4KuuS-cFbdA/formResponse",
        {
          method: "POST",
          mode: "no-cors",
          body: formPayload,
        }
      );
      setSubmitted(true);
    } catch (error) {
      console.error("Submission error", error);
    }
  };

  if (submitted) {
    return (
      <div className="max-w-xl mx-auto p-6 bg-white shadow rounded">
        <h2 className="text-2xl font-bold text-green-700 mb-4">Thank You!</h2>
        <p className="text-gray-700">
          Your order has been received. You'll get a confirmation email shortly.
        </p>
      </div>
    );
  }

  return (
    <div className="max-w-2xl mx-auto bg-white shadow-md rounded p-6 mt-8">
      <h2 className="text-2xl font-semibold mb-4 text-green-800">
        TropiNord Product Order Form
      </h2>
      <form onSubmit={handleSubmit} className="space-y-4">
        <div>
          <label className="block mb-1 font-medium">Name *</label>
          <input
            type="text"
            name="name"
            value={formData.name}
            onChange={handleChange}
            required
            className="w-full border px-3 py-2 rounded"
          />
        </div>

        <div>
          <label className="block mb-1 font-medium">Email *</label>
          <input
            type="email"
            name="email"
            value={formData.email}
            onChange={handleChange}
            required
            className="w-full border px-3 py-2 rounded"
          />
        </div>

        <div>
          <label className="block mb-2 font-medium">Select Products *</label>
          <div className="grid grid-cols-2 gap-2">
            {productOptions.map((option) => (
              <label key={option} className="flex items-center gap-2">
                <input
                  type="checkbox"
                  value={option}
                  checked={formData.products.includes(option)}
                  onChange={handleChange}
                />
                {option}
              </label>
            ))}
          </div>
        </div>

        <div>
          <label className="block mb-1 font-medium">Quantity / Notes *</label>
          <textarea
            name="notes"
            value={formData.notes}
            onChange={handleChange}
            required
            rows="4"
            className="w-full border px-3 py-2 rounded"
          ></textarea>
        </div>

        <button
          type="submit"
          className="bg-green-600 text-white px-6 py-2 rounded hover:bg-green-700"
        >
          Submit
        </button>
      </form>
    </div>
  );
};

export default OrderForm;
